import React, { useState } from "react";
import Modal from "react-modal";
import { useNavigate } from "react-router-dom";
import Logo from "../../assets/img/Brasao_ufra.png";

Modal.setAppElement("#root");

const AdminHomePage = () => {
  const navigate = useNavigate()

  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <img src={Logo} width="50px" height="50px" alt="Logo da Ufra" />
          <a className="navbar-brand ms-2" href="#navbarNavAltMarkup">
            Museu de Entomologia
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div
            className="collapse navbar-collapse justify-content-end"
            id="navbarNavAltMarkup"
          >
            <div className="navbar-nav">
              <button type="button" className="btn btn-outline-light ms-2" onClick={() => {
                    navigate("/")
                  }}>
                Voltar para Home
              </button>
            </div>
          </div>
        </div>
      </nav>


      <div class="position-absolute top-50 start-50 translate-middle">
                  <button></button>




      </div>

    </>
  );
};

export default AdminHomePage;
